DROP TABLE IF EXISTS `transcript`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `transcript` (
  `trans_id` int NOT NULL,
  `gene_id` int DEFAULT NULL,
  `Ensembl_trans_id` text,
  `trans_class_id` int DEFAULT NULL,
  `strand` text,
  `trans_start` int DEFAULT NULL,
  `trans_end` int DEFAULT NULL,
  `exon_count` int DEFAULT NULL,
  `coding_start` int DEFAULT NULL,
  `coding_end` int DEFAULT NULL,
  `prot_id` int DEFAULT NULL,
  PRIMARY KEY (`trans_id`),
  KEY `transcript_gene_gene_id_fk` (`gene_id`),
  KEY `transcript_protein_protein_id_fk` (`prot_id`),
  KEY `transcript_transcript_class_trans_class_id_fk` (`trans_class_id`),
  CONSTRAINT `transcript_gene_gene_id_fk` FOREIGN KEY (`gene_id`) REFERENCES `gene` (`gene_id`),
  CONSTRAINT `transcript_protein_protein_id_fk` FOREIGN KEY (`prot_id`) REFERENCES `protein` (`prot_id`),
  CONSTRAINT `transcript_transcript_class_trans_class_id_fk` FOREIGN KEY (`trans_class_id`) REFERENCES `transcript_class` (`trans_class_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
